import useInput from "./logic";
function Claculate(){
const[nigger, niggerr]=useInput()
const[calc,setCalc]=React.useState()

    let inn=(e)=>{
        e.preventDefault()
        if(nigger<35000){
          let calc=(nigger*0.014)
          setCalc(calc.toFixed())
         }else {
         let calc=(nigger-nigger +520)
        setCalc(calc.toFixed(1))
         }
}
return(
   <div>
   <form onSubmit={inn}>
       
        {niggerr}
        <button className="btn" type="sumbit">Oblicz</button>
    </form>
  
    <div>Oplata B{calc}</div>
    </div>
)




}
